import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import './index.css';

// Create a root container for the React app
const root = ReactDOM.createRoot(document.getElementById('portfolio-gallery'));

// Render the App component
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
